import { Component } from 'react'
import ReviewHighlight from './ReviewHighlight'

class LeftScroll extends Component {
    render() {
        return (
            <div class="leftscroll flexitem">
                <h1>Left Scroll</h1> 
                <table>
                    <tbody>
                        <tr>
                            <td>
                                New Review &nbsp;
                                <svg onClick = {() => this.props.toggleNewReview()} xmlns="http://www.w3.org/2000/svg" width="16" height="16" fill="currentColor" class="bi bi-plus-circle" viewBox="0 0 16 16">
                                    <path d="M8 15A7 7 0 1 1 8 1a7 7 0 0 1 0 14zm0 1A8 8 0 1 0 8 0a8 8 0 0 0 0 16z"/>
                                    <path d="M8 4a.5.5 0 0 1 .5.5v3h3a.5.5 0 0 1 0 1h-3v3a.5.5 0 0 1-1 0v-3h-3a.5.5 0 0 1 0-1h3v-3A.5.5 0 0 1 8 4z"/>
                                </svg>
                            </td>
                        </tr>
                    </tbody>
                </table>
                <table>
                    <tbody>
                        {
                            this.props.reviews.map((review) => {
                                return <ReviewHighlight key = {review._id} review = {review} getDisplayedReview = {this.props.getDisplayedReview} />
                            })
                        }
                    </tbody>
                </table>
            </div>
        )
    }
}

export default LeftScroll
